import React from "react";

const ReactExercises = () => {
  const users = [
    { name: "Joanne", id: "1" },
    { name: "Linta", id: "2" },
    { name: "Maria", id: "3" },
  ];
  const username = users.map((user) => <li key={user.id}>{user.name}</li>);
  return (
    <div>
      <ul>{username}</ul>
      <Button>Hide</Button>
    </div>
  );
};

export default ReactExercises;
